INSERT INTO `layanan_personals` VALUES (10, '<h3><font face=\"Helvetica\">Kepesertaan BPJS Ketenagakerjaan dan BPJS Kesehataan</font></h3>', NULL, '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\">Setiap pekerja mempunyai hak akan kepersertaan BPJS Ketenagakerjaan dan BPJS Kesehatan untuk dirinya beserta keluarganya. Kami membantu menyelesaikan masalah ini agar pihak perusahaan mendaftarkan dan melaporkan dengan data gaji yang sebenarnya.</span><br></p>', 'http://localhost:8000/storage/layanan/personal/1714094232about.jpg', '1', NULL, '2024-04-18 14:41:06', '2024-04-26 01:24:31');
INSERT INTO `layanan_personals` VALUES (11, '<h3>Hak - Hak Normatif Lainnya</h3>', NULL, '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\">Hak normatif pekerja adalah hak - hak pekerja yang lahir sebagai upaya memberi perlindungan terhadap pekerja yang harus dipenuhi oleh pengusaha yang diatur dalam Peraturan Perundang - undangan Perjanjian Kerja, Peraturan Perusahaan atau Perjanjian Kerja Bersama yang bersifat mengikat pekerja dan pengusaha.</span><br></p>', 'http://localhost:8000/storage/layanan/personal/1713452989about.jpg', '1', NULL, '2024-04-18 14:56:56', '2024-04-26 01:25:53');
INSERT INTO `layanan_personals` VALUES (12, '<h3>Pensiun</h3>', NULL, '<p>tes</p>', 'http://localhost:8000/storage/layanan/personal/1714094804about.jpg', '1', NULL, '2024-04-26 01:26:44', '2024-04-26 08:28:16');
INSERT INTO `layanan_personals` VALUES (13, '<h3>Status Karyawan</h3>', NULL, '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\">Setiap pekerja berharap bisa mendapatkan kejelasan status kerjanya, misalnya menjadi karyawan tetap atau berstatus PKWTT. Kebanyakan yang terjadi adalah ketidak pastian status, lebih banyak karyawan/pekerja di pekerjakan dengan status kontrak/PKWT secara terus menerus. Kami membantu jika terjadi penyimpangan kontrak kerja/PKWT yang dilakukan oleh perusahaan yang merugikan karyawan/pekerja dan membantu memperjuangkan status sebagai karyawan tetap jika kontrak kerja/PKWT yang dilakukan oleh perusahaan tidak benar.</span><br></p>', 'http://localhost:8000/storage/layanan/personal/1714094868about.jpg', '1', NULL, '2024-04-26 01:27:49', '2024-04-26 08:28:18');
INSERT INTO `layanan_personals` VALUES (14, '<h3>PHK (Pemutusan Hubungan Kerja)</h3>', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\">Setiap pekerja bisa saja mengalami PHK oleh perusahaan, yang di khawatirkan adalah PHK...</span><br></p>', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\">Setiap pekerja bisa saja mengalami PHK oleh perusahaan, yang di khawatirkan adalah PHK yang dilakukan tidak sesuai dengan Undang-Undang. Kami membantu menangani masalah karyawan/pekerja yang di PHK oleh perusahaan dengan alasan apapun yang merugikan pekerja tersebut, guna mendapatkan hak normatif dari pesangon dan hak-hak lainnya sesuai dengan Undang-Undang ketenagakerjaan yang berlaku.</span><br></p>', 'http://localhost:8000/storage/layanan/personal/1714095996about.jpg', '1', NULL, '2024-04-26 01:46:36', '2024-04-26 03:33:23');

