INSERT INTO `point_section` VALUES (1, 1, 'http://localhost:8000/storage/logo-sdm/1714125404kpi.png', '<p><b>KPI BASED PEFORMANCE</b></p>', '<p><span style=\"color: rgb(24, 24, 24); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px;\">Performance appraisal atau penilaian kerja merupakan proses yang dilakukan organisasi atau perusahaan dalam rangka menilai atau mengevaluasi prestasi atau kinerja karyawan.</span><br></p>', 'managemen-sdm', NULL, '2024-04-26 16:56:44');
INSERT INTO `point_section` VALUES (2, 2, 'http://localhost:8000/storage/logo-sdm/1714121465circle.png', '<p><b>BUSINESS PLANING</b></p>', '<p><span style=\"color: rgb(24, 24, 24); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px;\">Strategi bisnis yang terencana dengan matang dan penempatan tenaga ahli pada porsi yang tepat akan menghasilkan ekosistem yang baik bagi perusahaan itu sendiri.</span><br></p>', 'managemen-sdm', NULL, '2024-04-26 17:01:03');
INSERT INTO `point_section` VALUES (3, 3, 'http://localhost:8000/storage/logo-sdm/1714121466circle.png', '<p><b>HR STRATEGI AND PROGRAME</b></p>', '<p><span style=\"color: rgb(24, 24, 24); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px;\">Strategi sumber daya manusia harus bisa berfungsi sebagai jembatan antara manajemen sumber daya manusia dan target dari sebuah perusahaan.</span><br></p>', 'managemen-sdm', NULL, '2024-04-26 17:07:01');
INSERT INTO `point_section` VALUES (4, 4, 'http://localhost:8000/storage/logo-sdm/1714121525data-management.png', '<p><b>DIAGNOSING ORGANIZATIONAL EFFECTIVENESS</b></p>', '<p><span style=\"color: rgb(24, 24, 24); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px;\">Sebuah perusahaan akan berjalan dengan efektif hingga menimbulkan suasanya kerja yang nyaman apabila organisasi yang ada di dalamnya tertata dengan baik.</span><br></p>', 'managemen-sdm', NULL, '2024-04-26 17:02:41');
INSERT INTO `point_section` VALUES (5, 5, 'http://localhost:8000/storage/logo-sdm/1714125855data-analytics.png', '<p><b>CARRIR DEVELOPMENT PROGRMS</b></p>', '<p><span style=\"color: rgb(24, 24, 24); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px;\">Program pengembangan karir bagi SDM yang akan menciptakan semangat baru untuk seluruh karyawan yang bekerja pada sebuah perusahaan.</span><br></p>', 'managemen-sdm', NULL, '2024-04-26 17:06:40');
INSERT INTO `point_section` VALUES (6, 6, 'http://localhost:8000/storage/logo-sdm/1714125977consistency.png', '<p><b>COMPENTATION AND BENEFIT</b></p>', '<p><span style=\"color: rgb(24, 24, 24); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px;\">Compentation and Benefit adalah hal yang sensitif dan harus dikerjakan dengan ketelitian yang tinggi agar cashflow perusahaan tetap sehat dan lancar.</span><br></p>', 'managemen-sdm', NULL, '2024-04-26 17:07:35');

