INSERT INTO `untility` VALUES (1, 'Konsultan Manajemen SDM', '<div style=\"font-family: Consolas, &quot;Courier New&quot;, monospace; line-height: 19px; white-space: pre;\"><p style=\"\"><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\">Solusi Human Capital &amp; Business Consultant sebagai solusi dalam pengembangan Sumber Daya Manusia<br></span></font><span style=\"font-family: Helvetica; color: rgb(0, 0, 0); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">berdasarkan pengalaman praktisi dalam bidang-bidang pengembangan sumber daya manusia, <br></span><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\">pusat dokumentasi &amp; informasi, perbankan, keuangan dan perpajakan. </span></font></p></div>', NULL, 'managemen-sdm', NULL, NULL, '2024-04-26 17:20:05');
INSERT INTO `untility` VALUES (2, 'Pentingnya Pelatihan HR & SDM', '<p style=\"text-align: justify; \"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Karyawan yang bekerja pada sebuah organisasi atau perusahaan harus kompeten dalam bidan pekerjaan yang menjadi tugas serta tanggung jawabnya.</span></p><p style=\"text-align: justify; \"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Oleh karena itu sangat dibutuhkan pembekalan ilmu agar tenaga kerja dapat lebih menguasai serta kompeten pada bidangnya masing-masing dan dapat meningkatkan kinerja. </span></p><p style=\"text-align: justify; \"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Dengan adanya program pelatihan atau pembekalan, proses pengembangan diri serta evaluasi karyawan menjadi lebih tertata mulai dari karyawan taraf standar hingga staff khusus tingkat atas.</span><br></p>', NULL, 'pelatihan', NULL, NULL, '2024-04-26 09:41:19');
INSERT INTO `untility` VALUES (3, 'Tentang  REWATA CONSULTANT', '<p style=\"text-align: justify; \"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Dengan didukung oleh tenaga tenaga ahli / konsultan yang handal, profesional dan berpengalaman yang sangat luas di berbagai bidang, REWATA Consultant akan mampu memberikan nilai lebih dalam memberikan solusi atas kebutuhan Klien. REWATA Consultant bertekad menjadi mitra konsultan terpercaya, mampu menterjemahkan kebutuhan Klien kedalam solusi dan memberikan pelayanan yang terbaik bagi semua Perusahaan dan Individu tanpa melihat Besar kecilnya Perusahaan, Jabatan dan Status Individu dengan mengutamakan kehandalan, profesionalisme, dan kecepatan tanggap, sehingga dapat memberikan solusi tepat sesuai yang diharapkan.</span><br></p>', '<h4><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 16px; font-style: italic;\">REWATA Consultant merupakan Jasa Konsultasi :</span></h4><h4></h4><p></p><p></p><p></p><ol><ol></ol></ol><ol><ol></ol></ol><ol><ol></ol></ol><ol><ol></ol></ol><ol><ol></ol></ol><p></p><ol><li><span style=\"font-weight: 700;\">Manajemen HR</span></li><li><b>Sistem Managemen Perusahan</b></li><li><b>Bantuan Hukum</b></li><li><b>Pendampingan terkait Ketenagakerjaan</b></li><li><span style=\"font-weight: 700;\">Hubungan Industrial yang sangat mengutamakan kepuasan Klien serta menjunjung tinggi nilai-nilai profesionalisme kerja</span></li></ol>', 'tentang', NULL, NULL, '2024-04-26 15:03:27');

